import React,{ useEffect,useState } from "react";
import GetDataset from '../GetDataset/getDataset';
import LoadingSpinner from "../Modal/LoadingSpinner";

import './GenerateSchedulePage.css';

const GenerateSch = () => {
    const [isLoading, setIsLoading] = useState(false);
    const [loadedFile, setLoaadedFile] = useState(false);
    useEffect(()=>{
        const sendRequest = async () =>{
            setIsLoading(true);
            try{
            const response = await fetch('http://localhost:5000/api/uploadFile');
            const responsedata = await response.json();
            if (!response.ok){
                throw new Error(responsedata.message);
            }
            setLoaadedFile(responsedata);
            setIsLoading(true);
            }catch(err){
                console.log(err.message);
            }
            setIsLoading(false);
        };
        sendRequest();
    }, []);
    return (
        <React.Component>
        <div className="GenerateSch-section">
            <h1>
                Generate Schedule Page 
            </h1>
            {isLoading && <div className="center"><LoadingSpinner/></div>}
            {!isLoading && loadedFile && <h2 items = {loadedFile}></h2>}
        </div>
        </React.Component>
    );
};

export default GenerateSch;
